import React from 'react';
import PropTypes from 'prop-types';

export default function NavbarComponent(props) {
  const navbarClass = `navbar navbar-expand-lg navbar-${props.mode} bg-${props.mode}`;
  const formSwitchClass = `form-check form-switch text-${props.mode === 'light' ? 'dark' : 'light'}`;
  const greenFormSwitchClass = `form-check form-switch text-${props.mode === 'light' ? 'green' : 'dark'}`;

  return (
    <nav className={navbarClass}>
      <div className="container-fluid">
        <a className="navbar-brand" href="/">{props.title}</a>
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarSupportedContent">
          <ul className="navbar-nav me-auto mb-2 mb-lg-0">
            <li className="nav-item">
              <a className="nav-link active" aria-current="page" href="/">Home</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="/about">{props.aboutText}</a>
            </li>
          </ul>
          <div className={formSwitchClass}>
            <input className="form-check-input" onChange={props.toggleMode} type="checkbox" role="switch" id="flexSwitchCheckDefault" />
            <label className="form-check-label" htmlFor="flexSwitchCheckDefault"> Dark Mode (Grey)</label>
          </div>
          <div className={greenFormSwitchClass}>
            <input className="form-check-input" onChange={props.toggleMode} type="checkbox" role="switch" id="flexSwitchCheckDefault" />
            <label className="form-check-label" htmlFor="flexSwitchCheckDefault"> Dark Mode (Green)</label>
          </div>
        </div>
      </div>
    </nav>
  );
}

NavbarComponent.propTypes = {
  title: PropTypes.string.isRequired,
  aboutText: PropTypes.string.isRequired,
  mode: PropTypes.string.isRequired,
  toggleMode: PropTypes.func.isRequired
};

NavbarComponent.defaultProps = {
  title: 'Set Title Here',
  aboutText: 'About Here'
};
